import React, { Component } from 'react'

export default class Historia extends Component {
    render() {
        return (
             <div class="carousel-item col-3 active m-0 p-1">
             <div className="card bg-dark text-white border-0 historia text-white bg-dark">
                 <img className="card-img img-responsive center-block" src="https://media.metrolatam.com/2018/02/12/web11880-1200x0.jpg" alt="" />
                 <div className="card-img-overlay">
                 </div>
                 <div class="card-footer bg-transparent border-0 p-0"><small className=" text-weight-bold m-0">Gabriela Astudillo</small></div>
                 
             </div>
         </div>

        )
    }
}
